import React from "react";
import HeadCon from "../containers/newheader";
import HomeCom from "../component/home";
import { HomCon } from "../component";

export default function Home({isLogin,...rest}) {
    console.log(`home ${isLogin}`);
    return (
        <>
                <HeadCon/>
                <HomeCom>
                    <HomeCom.Title>A Safe Place{"\n"}For Fanfiction Writer </HomeCom.Title>
                    <HeadCom.TextBlock>AO3, also known as Archive of Our Own, is a non-profit, fan-created archive for fan fiction, fan vids, and other fanworks. It is run by the Organization for Transformative Works (OTW) and was created in 2008 to provide a space for fanworks that may not be accepted on other platforms. It allows users to upload, share, and read fan fiction, fan art, and other fan-created content in a wide variety of fandoms. It has a large and active community of users and is considered one of the most popular fan fiction archives on the internet.</HeadCom.TextBlock>
                    <HomeCom.PicCon>
                        <HomeCom.PicLeft src={process.env.PUBLIC_URL + '/images/pic1.png'}></HomeCom.PicLeft>
                        <HomeCom.PicRight src={process.env.PUBLIC_URL + '/images/pic2.jpg'}></HomeCom.PicRight>
                    </HomeCom.PicCon>
                </HomeCom>
        </>
    )
}
